type SectorLevel int

const (
	Sector SectorLevel = iota
	IndustryGroup
	Industry
	SubIndustry
)

func GetSP500Constituents() ([]string, []string) {
	identifier := make([]string, 0)
	description := make([]string, 0)

	for _, v := range SP500 {
		identifier = append(identifier, "WIKI/"+v.Ticker)
		description = append(description, v.Name)
	}

	return identifier, description
}

func GetConstituents(maxRank int) ([]string, []string) {
	identifier, _, description := GetSectorMappings(Sector, maxRank)

	return identifier, description
}

func GetOthers() ([]string, []string) {
	identifier := make([]string, 0)
	stockName := make([]string, 0)

	for _, v := range Others {
		identifier = append(identifier, v.Ticker)
		stockName = append(stockName, v.Name)
	}

	return identifier, stockName
}

func GetSectorMappings(level SectorLevel, maxRank int) ([]string, []string, []string) {
	identifier := make([]string, 0)
	description := make([]string, 0)
	stockName := make([]string, 0)

	for _, v := range Russell3000 {
		if v.Rank <= maxRank {
			identifier = append(identifier, v.Ticker)
			stockName = append(stockName, v.Name)
			if level == SubIndustry {
				description = append(description, v.SubIndustry)
			} else if level == Industry {
				description = append(description, v.Industry)
			} else if level == IndustryGroup {
				description = append(description, v.IndustryGroup)
			} else {
				description = append(description, v.Sector)
			}
		} else {
			break
		}
	}

	if maxRank == MAX_RANK {
		for _, v := range MLPs {
			identifier = append(identifier, v.Ticker)
			stockName = append(stockName, v.Name)
			if level == SubIndustry {
				description = append(description, v.SubIndustry)
			} else if level == Industry {
				description = append(description, v.Industry)
			} else if level == IndustryGroup {
				description = append(description, v.IndustryGroup)
			} else {
				description = append(description, v.Sector)
			}
		}
	}

	return prependList("WIKI/", identifier), appendList(description, " Stocks"), stockName
}

func GetSectorNames(level SectorLevel) []string {
	_, description, _ := GetSectorMappings(level, MAX_RANK)

	return unique(description)
}

func unique(input []string) []string {
	u := make(map[string]int)
	s := make([]string, 0, len(input))

	// Put the strings into the map
	for _, v := range input {
		u[v] = u[v] + 1
	}

	// Append all the keys into the map
	for v, _ := range u {
		s = append(s, v)
	}

	sort.Strings(s)

	return s
}

func appendList(list []string, suffix string) []string {
	newList := make([]string, len(list), len(list))

	for i, v := range list {
		newList[i] = v + suffix
	}

	return newList
}

func prependList(prefix string, list []string) []string {
	newList := make([]string, len(list), len(list))

	for i, v := range list {
		newList[i] = prefix + v
	}

	return newList
}
